import React, { useState } from 'react';
import './styles.css'; // Import the CSS file containing styles

// Stakeholder Component
const Stakeholder = ({ onAdd, onRemove }) => {
  const [childName, setChildName] = useState('');

  const handleAddChild = () => {
    if (childName.trim() === '') {
      alert('Please enter a valid name for the child.');
      return;
    }

    onAdd(childName);
    setChildName('');
  };

  return (
    <div className="holon stakeholder">
      <div className="name">Stakeholder</div>
      <button className="add-button" onClick={handleAddChild}>+</button>
      <button className="remove-button" onClick={onRemove}>x</button>
    </div>
  );
};

// InformationSystem Component
const InformationSystem = ({ onAdd, onRemove }) => {
  const [childName, setChildName] = useState('');

  const handleAddChild = () => {
    if (childName.trim() === '') {
      alert('Please enter a valid name for the child.');
      return;
    }

    onAdd(childName);
    setChildName('');
  };

  return (
    <div className="holon information-system">
      <div className="name">Information System</div>
      <button className="add-button" onClick={handleAddChild}>+</button>
      <button className="remove-button" onClick={onRemove}>x</button>
    </div>
  );
};

// Infrastructure Component
const Infrastructure = ({ onAdd, onRemove }) => {
  const [childName, setChildName] = useState('');

  const handleAddChild = () => {
    if (childName.trim() === '') {
      alert('Please enter a valid name for the child.');
      return;
    }

    onAdd(childName);
    setChildName('');
  };

  return (
    <div className="holon infrastructure">
      <div className="name">Infrastructure</div>
      <button className="add-button" onClick={handleAddChild}>+</button>
      <button className="remove-button" onClick={onRemove}>x</button>
    </div>
  );
};

// App Component
const App = () => {
  const [stakeholderChildren, setStakeholderChildren] = useState([]);
  const [informationSystemChildren, setInformationSystemChildren] = useState([]);
  const [infrastructureChildren, setInfrastructureChildren] = useState([]);

  const addChild = (parent, childName) => {
    switch (parent) {
      case 'stakeholder':
        setStakeholderChildren([...stakeholderChildren, childName]);
        break;
      case 'informationSystem':
        setInformationSystemChildren([...informationSystemChildren, childName]);
        break;
      case 'infrastructure':
        setInfrastructureChildren([...infrastructureChildren, childName]);
        break;
      default:
        break;
    }
  };

  const removeChild = (parent, childName) => {
    switch (parent) {
      case 'stakeholder':
        setStakeholderChildren(stakeholderChildren.filter(child => child !== childName));
        break;
      case 'informationSystem':
        setInformationSystemChildren(informationSystemChildren.filter(child => child !== childName));
        break;
      case 'infrastructure':
        setInfrastructureChildren(infrastructureChildren.filter(child => child !== childName));
        break;
      default:
        break;
    }
  };

  return (
    <div className="container">
      <div className="stakeholder-container">
        <Stakeholder
          onAdd={(childName) => addChild('stakeholder', childName)}
          onRemove={(childName) => removeChild('stakeholder', childName)}
        />
      </div>
      <div className="information-system-container">
        <InformationSystem
          onAdd={(childName) => addChild('informationSystem', childName)}
          onRemove={(childName) => removeChild('informationSystem', childName)}
        />
      </div>
      <div className="infrastructure-container">
        <Infrastructure
          onAdd={(childName) => addChild('infrastructure', childName)}
          onRemove={(childName) => removeChild('infrastructure', childName)}
        />
      </div>
    </div>
  );
};

export default App;
